/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */

export type LtcUTXO = {
    /**
     * Version of the UTXO.
     */
    version?: number;
    height?: number;
    /**
     * Amount of UTXO in LTC.
     */
    value?: string;
    /**
     * Data generated by a spender which is almost always used as variables to satisfy a pubkey script.
     */
    script?: string;
    /**
     * Address of the owner of the UTXO.
     */
    address?: string;
    /**
     * Coinbase transaction - miner fee.
     */
    coinbase?: boolean;
    /**
     * Transaction hash.
     */
    hash?: string;
    /**
     * Transaction index of the output.
     */
    index?: number;
}
